import React from 'react'
import Grid from '@mui/material/Grid'

const Personajes = ({personaje = []}) =>{

    return(

    <div >
                  { personaje.map(pers => {
                      return <div>
                          <Grid container spacing={2}>
                              <Grid item xs={4}>
                                <img src={pers.image} alt="" />   
                              </Grid>
                          </Grid>
                      
                     </div>
                  })
                  }
    </div>
)
}

export default Personajes
